import React from 'react';
import styled from 'styled-components';
import AppleLogo from '../assets/images/apple-brands.svg';

const Header = () => {
  return (
    <>
      <NavStyled>
        <UlStyled>
          <li>
            <AppleLogo />
          </li>
        </UlStyled>
      </NavStyled>
    </>
  );
};

const NavStyled = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #313132;
`;

const UlStyled = styled.ul`
  display: flex;
  list-style: none;
  font-size: 12px;
  margin-left: 10%;
`;

export default Header;
